import React, { Component } from 'react';
import Prompt from '../Posts/Prompt'
import CreatePost from '../Posts/NewPostForm'

class Feed extends Component {

    getPrompts(){
        var posts = this.props.posts
        if(posts){
            return(
                posts.map((post,i) => 
                    <Prompt 
                        key={post.id} 
                        id={post.id} 
                        title={post.title} 
                        content={post.content}
                    />
                )
            )
        }
    }

    render() {
        return (
            <div>
                <CreatePost/>
                {this.getPrompts()}
            </div>
        );
    }
}

export default Feed;
